import Header from "./topnavbar";
const ContentsBody = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`;
const Result = ({ children }) => (
  <div>
    <Header />
    <ContentsBody>
      <div class="container">
        <div class="row">
          <div class="col-md-1"></div>
          <div class="col-md-10">{children}</div>
          <div class="col-md-1"></div>
        </div>
      </div>
    </ContentsBody>
  </div>
);

export default Result;
